# Function to parse the HTML and extract room information
def extract_rooms(html):
    soup = BeautifulSoup(html, 'html.parser')
    rooms = []

    for room in soup.select('app-room'):
        room_element = room.select_one('strong a')
        company_element = room.select_one('.flex-default > div:nth-of-type(2)')
        location_element = room.select_one('.flex-default > div:nth-of-type(3) i')

        room_data = {
            'room': room_element.get_text(strip=True) if room_element else '',
            'url': room_element.attrs.get('href') if room_element else '',
            'company': company_element.get_text(strip=True) if company_element else '',
            'location': location_element.get_text(strip=True) if location_element else ''
        }
        rooms.append(room_data)

    return rooms


# Function to fetch coordinates asynchronously
async def get_coordinates(session, location):
    await asyncio.sleep(2)
    api_key = ''  # Replace with your actual API key from https://geocode.maps.co/
    url = f'https://geocode.maps.co/search?q={location}&api_key={api_key}'

    try:
        async with session.get(url) as response:
            data = await response.json()
            if data:
                lat, lon = data[0].get('lat'), data[0].get('lon')
                return {'latitude': lat, 'longitude': lon}
            else:
                return {'latitude': None, 'longitude': None}
    except Exception as e:
        print(f'Error fetching coordinates for location "{location}": {e}')
        return {'latitude': None, 'longitude': None}


# Process each room to get coordinates with a delay between requests
async def process_rooms_with_coordinates(rooms):
    rooms_with_coordinates = []

    async with aiohttp.ClientSession() as session:
        for idx, room in enumerate(rooms):
            coordinates = await get_coordinates(session, room['location'])
            room_with_coords = {**room, **coordinates}
            rooms_with_coordinates.append(room_with_coords)

            print('Rooms left: ' + str(len(rooms) - idx - 1))
    return rooms_with_coordinates


